import React, { useCallback, useEffect, useMemo, useState } from 'react';
import { Button, Col, Container, Form, Row } from 'react-bootstrap';
import { Map, TileLayer, Marker } from 'react-leaflet';
import { Icon } from 'leaflet';
import 'leaflet/dist/leaflet.css';

export const icon = new Icon({
  iconUrl: 'https://s3-us-west-2.amazonaws.com/s.cdpn.io/134893/pin-red.svg',
  iconSize: [25, 25],
});

const Home = () => {
  const [latitude, setLatitude] = useState('43.296482');
  const [longitude, setLongitude] = useState('5.36978');

  const handleInputLatitudeChange = (event) => {
    const { value } = event.target;
    setLatitude(value);
  };

  const handleInputLongitudeChange = (event) => {
    const { value } = event.target;
    setLongitude(value);
  };

  const update = () => {};

  return (
    <Container className="homePage">
      <Form>
        <Form.Group controlId="formBasicEmail">
          <Form.Label>Recherche par ville</Form.Label>
          <Form.Control type="text" placeholder="Saisir le nom d'une ville" />
        </Form.Group>

        <Button variant="warning" type="submit">
          Envoyer
        </Button>
      </Form>

      <br />

      <Form>
        <Form.Group controlId="coord">
          <Form.Label>Recherche par coordonn√©es</Form.Label>
          <Row>
            <Col>
              Latitude
              <Form.Control
                type="text"
                placeholder="Saisir la latitude"
                value={latitude}
                onChange={handleInputLatitudeChange}
              />
            </Col>
            <Col>
              Longitude
              <Form.Control
                type="text"
                placeholder="Saisir la longitude"
                value={longitude}
                onChange={handleInputLongitudeChange}
              />
            </Col>
          </Row>
        </Form.Group>

        <Button variant="warning" onClick={update}>
          Envoyer
        </Button>
      </Form>
      <br />
      <MapContainer
        center={[latitude, longitude]}
        zoom={13}
        scrollWheelZoom={false}
      >
        <TileLayer
          attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        />
        <Marker position={[latitude, longitude]} icon={icon} />
      </MapContainer>
      <p>Salut</p>
      <ExternalStateExample />
    </Container>
  );
};
export default Home;

const center = [51.505, -0.09];
const zoom = 13;

function DisplayPosition({ map }) {
  const [position, setPosition] = useState(map.getCenter());

  const onClick = useCallback(() => {
    map.setView(center, zoom);
  }, [map]);

  const onMove = useCallback(() => {
    setPosition(map.getCenter());
  }, [map]);

  useEffect(() => {
    map.on('move', onMove);
    return () => {
      map.off('move', onMove);
    };
  }, [map, onMove]);

  return (
    <p>
      latitude: {position.lat.toFixed(4)}, longitude: {position.lng.toFixed(4)}{' '}
      <button onClick={onClick}>reset</button>
    </p>
  );
}

function ExternalStateExample() {
  const [map, setMap] = useState(null);

  const displayMap = useMemo(
    () => (
      <Map
        center={center}
        zoom={zoom}
        scrollWheelZoom={false}
        whenCreated={setMap}
      >
        <TileLayer
          attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        />
        <Marker position={center} icon={icon} />
      </Map>
    ),
    []
  );

  return (
    <div>
      {map ? <DisplayPosition map={map} /> : null}
      {displayMap}
    </div>
  );
}
